	`mb_no`
);

ALTER TABLE `news_member` ADD CONSTRAINT `FK_member_TO_news_member_1` FOREIGN KEY (
	`mb_no`
)
REFERENCES `member` (
	`mb_no`
);

ALTER TABLE `account` ADD CONSTRAINT `FK_member_TO_account_1` FOREIGN KEY (
	`mb_no`
)
REFERENCES `member` (
	`mb_no`
);

